import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { FaUpload } from "react-icons/fa";
import tshirtImage from "../assets/tshirt.png";
import hoodieImage from "../assets/hoodies.png";
import mugImage from "../assets/mugs.png";

const Process = () => {
  const [selectedProduct, setSelectedProduct] = useState(tshirtImage);
  const [uploadedImage, setUploadedImage] = useState(null);

  const handleProductChange = (product) => {
    setSelectedProduct(product);
    setUploadedImage(null);
  };

  const handleImageUpload = (event) => {
    const file = event.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = () => setUploadedImage(reader.result);
      reader.readAsDataURL(file);
    }
  };

  return (
    <div className="container py-4">
      <div className="row">
        {/* Left Panel */}
        <div className="col-3  p-3  rounded">
          <h5>Select Product</h5>
          <button className="btn btn-light mb-2" onClick={() => handleProductChange(tshirtImage)}>
            <img src={tshirtImage} alt="T-Shirt" className="w-100 p-4" />
            T-Shirt
          </button>
          <button className="btn btn-light mb-2" onClick={() => handleProductChange(hoodieImage)}>
            <img src={hoodieImage} alt="Hoodie" className="w-100" />
            Hoodie
          </button>
          <button className="btn btn-light" onClick={() => handleProductChange(mugImage)}>
            <img src={mugImage} alt="Mug" className="w-100" />
            Mug
          </button>
        </div>

        {/* Middle Panel: Product Preview & Upload */}
        <div className="col-6  p-4  d-flex justify-content-center align-items-center">
          <div className="position-relative" style={{ width: "600px", height: "600px" }}>
            <img src={selectedProduct} alt="Product" className="w-100 h-100" />
            <label className="position-absolute d-flex flex-column align-items-center justify-content-center" style={{
              top: "50%", left: "50%", width: "200px", height: "200px",
              transform: "translate(-50%, -50%)", border: "2px dashed #fff", cursor: "pointer",
            }}>
              <FaUpload size={40} className="text-white" />
              <span className="text-white">Upload Image</span>
              <input type="file" accept="image/*" onChange={handleImageUpload} hidden />
            </label>
            {uploadedImage && (
              <img
                src={uploadedImage}
                alt="Uploaded Design"
                className="position-absolute"
                style={{ top: "50%", left: "50%", width: "200px", height: "200px", transform: "translate(-50%, -50%)" }}
              />
            )}
          </div>
        </div>

        {/* Right Panel: Customize Options */}
        <div className="col-3  p-3 ">
          <h5>Customize Options</h5>
          <label>Size</label>
          <select className="form-control mb-2">
            <option>Select size</option>
            <option>S</option>
            <option>M</option>
            <option>L</option>
            <option>XL</option>
          </select>
          <label>Color</label>
          <div className="d-flex mb-2">
            {["white", "black", "red", "blue", "green", "yellow"].map((color) => (
              <div key={color} className="rounded-circle border me-2" style={{ width: "30px", height: "30px", backgroundColor: color, cursor: "pointer" }}></div>
            ))}
          </div>
          <label>Quantity</label>
          <div className="d-flex">
            <button className="btn btn-outline-secondary">-</button>
            <input type="number" className="form-control text-center mx-2" defaultValue={1} style={{ width: "50px" }} />
            <button className="btn btn-outline-secondary">+</button>
          </div>
          <button className="btn btn-warning w-100 mt-3">Add to Cart</button>
        </div>
      </div>
    </div>
  );
};

export default Process;
